fields.formula:
concat( 
  "BR", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

if(field('Rating average')>=4.5,' FE - Far exceeds expectations', 
if(field('Rating average')>=3.75,' EX - Exceeds expectations', 
if(field('Rating average')>=3,' ME - Meets expectations', 
if(field('Rating average')>=2,' DR - Development required', 
if(field('Rating average')<2,' IR - Improvement required', '')))))
